    #[test]
    fn test_set_item_byte_then_zeros() {
        let fld0 = make_item(10, 20, 30, 40);
        let fld1 = make_item(10, 50, 0, 0);
        assert_eq(set_item_byte_then_zeros(fld0, 1, 50), fld1);
